import './App.css';
import Botonera from "./componentes/Botonera";
import Navbar from './componentes/Navbar';
import Footer from './componentes/Footer';

function App() {
  return (
    <div className="App">
        <Navbar/>
        <Botonera/>
    </div>
  );
}

export default App;
